import React from 'react';
import { Products } from '../../components/Dashboard/Products';

export interface MainProps {
  data: any;
}

const Main: React.SFC<MainProps> = ({ data }) => {
  return (
    <div className="col pt-5">
      <div className="container">
        <Products />
      </div>
    </div>
  );
};

export default Main;
